import React from "react";
import '../css/content.css';


function Navbar() {
  return (
    <div class="main">
      <div className="content-action">
        <div>
          <a href="#prev">icon-prev</a>
          <a href="#prev">icon-nex</a>
        </div>
        {/* <input className="content-search">Search</input> */}
        <div className="content-notificatino">notification</div>
        <div className="user">
          <div className="user-avatar"></div>
          <div className="user">
            <span>User Name</span>
            <span>User level</span>
          </div>
        </div>
      </div>
    </div>

  );
}

export default Navbar;
